import './App.css';
import CategoryList from './components/CategoryList';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Header from './components/Header';

function App() {
  return (
    <Router>
    <div>
      <Header/> 
      <Routes>
          <Route path="/" element={<CategoryList/>} />
        </Routes>
        <Footer/>
    </div>
    </Router>
  );
}

export default App;
